// src/components/AdminDashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from 'react-bootstrap';

const AdminDashboard = ({ onLogout }) => {
  return (
    <div style={styles.container}>
      <h1>Admin Dashboard</h1>

      <div>
        <h3>Manage Bus System</h3>
        <Link to="/add-route">
          <Button style={styles.button}>Add Route</Button>
        </Link>
        <Link to="/add-bus">
          <Button style={styles.button}>Add Bus</Button>
        </Link>
        <Link to="/add-schedule">
          <Button style={styles.button}>Add Schedule</Button>
        </Link>
      </div>

      <Button onClick={onLogout} style={styles.button}>Logout</Button>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '900px',
    margin: 'auto',
    padding: '20px',
    border: '1px solid #ccc',
    borderRadius: '8px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  button: {
    margin: '10px',
  },
};

export default AdminDashboard;
